const task = (value) => {
  const array = ['estudar', 'aprender', 'beber 치gua']
  array.map((element) => {
    return <li>{element}</li>
  })
  return (
    <li>{value}</li>
  );
}

function App() {
  return (
    <div className="App">
      {task('Ol치 mundo')}
    </div>
  );
}

export default App;
